import './App.css';
import MovieList from './component/MovieList';
import  {Router ,Routes} from "react-router-dom"
function App() {
  return (
    <div className="App">
    <Router>
      <Routes path="/" element={<MovieList/>} />
    </Router>

    </div>
  );
}

export default App;
